def extract_episodes(episodes, success_numbers):
    """
    Extracts episodes with successful grasps from the provided list of episodes.

    Args:
        episodes (list): List of tuples containing episode data.
        success_numbers (list): List of successful grasp numbers.

    Returns:
        list: Filtered list of episodes with successful grasps.
    """
    success_episodes = []
    episode_dict = dict(episodes)

    for problem, grasp_numbers in success_numbers.items():
        success_episodes.append((problem, [episode_dict[problem][g] for g in grasp_numbers]))

    return success_episodes


