def pos_euler2mat(pos, euler):
    return tf.affines.compose(pos, tf.euler.euler2mat(euler[0], euler[1], euler[2], axes="sxyz"), np.ones(3))


def pos_quat2mat(pos, quat):
    return tf.affines.compose(pos, tf.quaternions.quat2mat(quat), np.ones(3))


def mat2pos_quat(homogeneous_matrix):
    pos, rot_mat, Z, S = tf.affines.decompose(homogeneous_matrix)
    quat = tf.quaternions.mat2quat(rot_mat)
    return pos, quat


tf_matrix_from_pose = pos_quat2mat
pose_from_tf_matrix = mat2pos_quat


def transform_to_centroid(lifting_target, obj_pos, obj_quat):
    """
    Computes the transformation from the object pose to the centroid of the bounding box.
    Args:
        lifting_target (str): The name of the object.
        obj_pos (np.ndarray): The position of the object in the world frame.
        obj_quat (np.ndarray): The orientation of the object in quaternion format.
    Returns:
        np.ndarray: The transformation matrix from the object pose to the centroid of the bounding box.
    """
    Tworld_obj = pos_quat2mat(obj_pos, obj_quat)
    return pose_from_tf_matrix(Tworld_obj @ np.linalg.inv(bb_centers[lifting_target]))


import trimesh
from dataset.object_loader import ObjectInfo

oi = ObjectInfo(split='all')


def compute_transform_to_bb_center():
    name_and_transforms = {}
    for name in oi.names():
        mesh = trimesh.load_mesh(oi.obj_file(name)[0])
        T, extend = trimesh.bounds.oriented_bounds(mesh)
        name_and_transforms[name] = T
    return name_and_transforms
